# Create the data
#alpha = 2,5 or 10
def data(x,alpha,gama):
  if (alpha==2):
    C1 = 1/(1-1*np.exp(2))
    C2 = -C1
    u =  C1 + C2*np.exp(2*x)
  elif (alpha==5):
    C1 = 1/(1-np.exp(5))
    C2 = -C1
    u = C1 + C2*np.exp(5*x)
  else:
    C1 = 1/(1-np.exp(10))
    C2 = -C1
    u = C1 + C2*np.exp(10*x)
  return u
