# Peclet number
p = alpha*1/gama
# set m=u'(x)
def pde(u,x,alpha,gama):
    u,m = u
    dudx = [m, m*alpha/gama]
    return dudx
# as u(0)=0, we may assume that m(0)=u'(0)=0
