# Build the network

def pinn(Input_dim,Output_dim,Width,Depth):
  reg_fun = tf.keras.regularizers.l2
  reg_para = 1e-7
  act_fun = tf.math.sin
  #act_para = 1e-2

  model = tf.keras.Sequential()
  model.add(keras.layers.Dense(Width,input_shape=(Input_dim,),activation = act_fun,use_bias =True,
                               kernel_initializer='RandomNormal',bias_initializer='RandomNormal',kernel_regularizer=reg_fun(reg_para)))
  # for hidden layers
  if(Depth>2):
    for i in range(Depth-2):
      model.add(keras.layers.Dense(Width,input_shape=(Input_dim,),activation = act_fun,use_bias =True,
                               kernel_initializer='RandomNormal',bias_initializer='RandomNormal',kernel_regularizer=reg_fun(reg_para)))
  model.add(keras.layers.Dense(Output_dim,activation=None,use_bias = True,kernel_initializer='RandomNormal',bias_initializer='RandomNormal',kernel_regularizer=reg_fun(reg_para)))
  return model

