# Define custom loss function
def my_loss(x_in,model,a,alp):
    k=1
    x = tf.Variable(x_in,dtype=tf.float32)
    with tf.GradientTape() as g:
        g.watch(x)
        with tf.GradientTape() as gg:
            gg.watch(x)
            u = model(x)
        u_x = gg.gradient(u, x)     
    u_xx = g.gradient(u_x, x)
    
    int_loss = tf.reduce_mean(tf.square(alp*u_x - k*u_xx))
    bnd_loss = tf.square(u[0]) + tf.square(u[-1]-1.0)
    
    loss = int_loss + a*bnd_loss
    return loss, int_loss, bnd_loss

